import { BootstrapTable, TableHeaderColumn } from "react-bootstrap-table-next";
import React from "react";
import pic from "../assets/img/haland.jpeg";
const products = [];

function addProducts(quantity) {
  const startId = products.length;
  for (let i = 0; i < quantity; i++) {
    const id = startId + i;
    products.push({
      id: id,
      pic: pic,
      name: "Erling Haaland",
      potential: 92,
      overall: 88,
      age: 20,
      price: 2100 + i,
    });
  }
}

addProducts(5);

class Search extends React.Component {
  constructor(props) {
    super(props);
    this.selectedRowClass = this.selectedRowClass.bind(this);
  }

  selectedRowClass(row, isSelect) {
    if (isSelect) {
      if (row.id >= 3) {
        return "bigger-than-three-select-row";
      } else {
        return "less-than-three-select-row";
      }
    } else {
      return "";
    }
  }

  render() {
    console.log("hello");
    const selectRowProp = {
      mode: "checkbox",
      clickToSelect: true,
      // You can assign className with a string or function
      // String is most easy case but if you want to have more ability to custom the class name
      // you can assign a function
      className: this.selectedRowClass,
    };
    return (
      <BootstrapTable columnFilter={true}>
        <TableHeaderColumn dataField="id" isKey={true}>
          Player ID
        </TableHeaderColumn>
        <TableHeaderColumn dataField="pic" isKey={true}>
          Player Photo
        </TableHeaderColumn>
        <TableHeaderColumn dataField="name">Player Name</TableHeaderColumn>
        <TableHeaderColumn dataField="potential"> Potential</TableHeaderColumn>
        <TableHeaderColumn dataField="overall"> Overall</TableHeaderColumn>
        <TableHeaderColumn dataField="age"> Age</TableHeaderColumn>
        <TableHeaderColumn dataField="price"> Age</TableHeaderColumn>
      </BootstrapTable>
    );
  }
}
export default Search;
